tive-image><p>\\\"The\\u00a0<em>numerator<\\/em>\\u00a0counts\\u00a0how many parts we want. 3 of the 10 pieces are shaded, so 3 is our numerator. This means that the fraction representing the shaded part of the circle is 3\\/10. Does that make sense?\\\"<\\/p><oppia-noninteractive-image alt-with-value=\\\"&quot;numerator and denominator diagram&quot;\\\" caption-with-value=\\\"&quot;&quot;\\\" filepath-with-value=\\\"&quot;img_20171021_223040_777eltaqwa_height_123_width_490.png&quot;\\\"><\\/oppia-noninteractive-image><p>When Matthew felt he understood, he nodded.<\\/p><p>\\\"OK,\\\" said Mr. Baker. \\\"It's good to practice this until you're sure you know it, so let's try some of those questions again!\\\"<br><\\/p>\"},\"written_translations\":{\"translations_mapping\":{\"content\":{},\"default_outcome\":{}}},\"solicit_answer_details\":false},\"Numerator and Denominator\":{\"param_changes\":[],\"interaction\":{\"solution\":null,\"answer_groups\":[],\"default_outcome\":{\"param_changes\":[],\"feedback\":{\"content_id\":\"default_outcome\",\"html\":\"\"},\"dest\":\"Q1 on N and D\",\"refresher_exploration_id\":null,\"missing_prerequisite_skill_id\":null,\"labelled_as_correct\":false},\"customization_args\":{\"buttonText\":{\"value\":\"CONTINUE\"}},\"confirmed_unclassified_answers\":[],\"id\":\"Continue\",\"hints\":[]},\"recorded_voiceovers\":{\"voiceovers_mapping\":{\"content\":{\"es\":{\"file_size_bytes\":1506261,\"needs_update\":false,\"filename\":\"content-es-hd01d0f2u0d.mp3\"},\"hi-en\":{\"file_size_bytes\":993873,\"needs_update\":false,\"filename\":\"content-hi-en-1qad0l4oh9hzynrur85nx9a4i.mp3\"}},\"default_outcome\":{}}},\"classifier_model_id\":null,\"content\":{\"content_id\":\"content\",\"html\":\"<p>Matthew looked confused.<br><\\/p><p>\\\"Ah,\\\" said Mr. Baker. \\\"That just means how much of the whole thing do you want. Here, I\\u2019ll show you.\\u201d He picked up a napkin and a pencil. \\u201cLook,\\u201d he said, starting to draw.<\\/p><oppia-noninteractive-image alt-with-value=\\\"&quot;Sketch of circle divided into fifths.&quot;\\\" caption-with-value=\\\"&quot;&quot;\\\" filepath-with-value=\\\"&quot;fifthsC_height_172_width_216.png&quot;\\\"><\\/oppia-noninteractive-image><p>\\ufeff<br><\\/p><p>\\u201cHere\\u2019s a cake. Pretend it\\u2019s divided into five equal parts, OK?\\u201d Then he filled in two of the parts.<\\/p><oppia-noninteractive-image alt-with-value=\\\"&quot;Sketch of circle with 2\\/5 shaded.&quot;\\\" caption-with-value=\\\"&quot;&quot;\\\" filepath-with-value=\\\"&quot;shaded_fifthsC_height_172_width_216.png&quot;\\\"><\\/oppia-noninteractive-image><p>\\\"You can call that <em>two-fifths<\\/em>. And you write it like this:\\u00a0<strong><oppia-noninteractive-math raw_latex-with-value=\\\"&quot;\\\\\\\\frac{2}{5}&quot;\\\"><\\/oppia-noninteractive-math><\\/strong>.\\u00a0It means: the whole cake is cut up into <em>five<\\/em> equal pieces (that\\u2019s the number below the line) and you want <em>two<\\/em> of those pieces (the number on top). We call the top number the\\u00a0<strong>numerator<\\/strong>, and the bottom number the\\u00a0<strong>denominator<\\/strong>.\\\"<br><\\/p><oppia-noninteractive-image alt-with-value=\\\"&quot;numerator and denominator diagram&quot;\\\" caption-with-value=\\\"&quot;&quot;\\\" filepath-with-value=\\\"&quot;NDb_height_151_width_600.png&quot;\\\"><\\/oppia-noninteractive-image><p>\\\"Now let's see if you understand that!\\\" said Mr. Baker. \\\"Are you ready?\\\"<\\/p>\"},\"written_translations\":{\"translations_mapping\":{\"content\":{},\"default_outcome\":{}}},\"solicit_answer_details\":false}},\"param_specs\":{},\"language_code\":\"en\",\"init_state_name\":\"Introduction\",\"correctness_feedback_enabled\":false},\"is_moderator\":false,\"can_edit\":false,\"auto_tts_enabled\":true,\"exploration_id\":\"DIWZiVgs0km-\",\"session_id\":\"MJfwOrurV-vJoj2IA6Wwqvuo\",\"state_classifier_mapping\":{},\"is_super_admin\":false,\"additional_angular_modules\":[],\"ifra